import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import { Navbar, Nav, NavDropdown, Form, FormCheck } from 'react-bootstrap';
import useSound from 'use-sound';
import { useSecret } from './SecretContext';
import sounds from "./sounds"; // Importer les sons de manière centralisée
import 'bootstrap/dist/css/bootstrap.min.css';
import '../style/navbar.css'; // Assurez-vous que vos styles personnalisés sont bien appliqués

function Header() {
  const { getSecret } = useSecret();
  const [scrolled, setScrolled] = useState(false);
  const [canPlay, setCanPlay] = useState(true);

  const [playSound, { stop: stopSound }] = useSound(sounds.cogitoErgoSum, { volume: 0.5 });

  const handleMouseOver = (characterName) => {
    if (canPlay) {
      switch (characterName) {
        case 'AM':
          if (getSecret('amSecret')) {
            playSound(); // Ajoutez la logique appropriée pour les sons secrets ici
          }
          break;
        // Ajoutez des cas pour les autres personnages
        default:
          break;
      }
    }
  };

  const handleScroll = () => {
    setScrolled(window.scrollY > 50);
  };

  useEffect(() => {
    window.addEventListener("scroll", handleScroll);
    return () => window.removeEventListener("scroll", handleScroll);
  }, []);

  const handleToggle = () => {
    setCanPlay(prevCanPlay => !prevCanPlay);
    if (!canPlay) {
      stopSound(); // Arrête le son quand le toggle est désactivé
    }
  };

  return (
    <Navbar bg={scrolled ? "dark" : "black"} variant="dark" expand="lg" className={`navbar-custom ${scrolled ? "navbar-scrolled" : ""}`}>
      <Navbar.Brand as={Link} to="/">
        <img src={`${process.env.PUBLIC_URL}/favico.ico`} alt="" width="30" height="24" />
        IHNMAIMS
      </Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="mr-auto">
          <Nav.Link as={Link} to="/">Accueil</Nav.Link>
          <Nav.Link as={Link} to="/story">Histoire</Nav.Link>
          <NavDropdown title="Personnages" id="basic-nav-dropdown">
            <NavDropdown.Item as={Link} to="/character/AM" onMouseOver={() => handleMouseOver("AM")} onMouseOut={() => stopSound()}>
              A.M
            </NavDropdown.Item>
            <NavDropdown.Divider />
            <NavDropdown.Item as={Link} to="/character/Ted" onMouseOver={() => handleMouseOver("Ted")} onMouseOut={() => stopSound()}>
              Ted
            </NavDropdown.Item>
            <NavDropdown.Item as={Link} to="/character/Ellen" onMouseOver={() => handleMouseOver("Ellen")} onMouseOut={() => stopSound()}>
              Ellen
            </NavDropdown.Item>
            <NavDropdown.Item as={Link} to="/character/Nimdok" onMouseOver={() => handleMouseOver("Nimdok")} onMouseOut={() => stopSound()}>
              Nimdok
            </NavDropdown.Item>
            <NavDropdown.Item as={Link} to="/character/Benny" onMouseOver={() => handleMouseOver("Benny")} onMouseOut={() => stopSound()}>
              Benny
            </NavDropdown.Item>
            <NavDropdown.Item as={Link} to="/character/Gorrister" onMouseOver={() => handleMouseOver("Gorrister")} onMouseOut={() => stopSound()}>
              Gorrister
            </NavDropdown.Item>
          </NavDropdown>
          {getSecret("pageSecret") && (
            <Nav.Link as={Link} to="/Secret">Secret</Nav.Link>
          )}
        </Nav>
        <Form inline>
          <FormCheck
            type="switch"
            id="custom-switch"
            label={canPlay ? "Son Activé" : "Son Désactivé"}
            checked={canPlay}
            onChange={handleToggle}
          />
        </Form>
      </Navbar.Collapse>
    </Navbar>
  );
}

export default Header;
